import React, { Component } from 'react'
import axios from 'axios';
export class PostList extends Component {
    constructor(props) {
        super(props)

        this.state = {
             posts : []
        }
    }
    componentDidMount(){
        axios.get('https://newsapi.org/v2/everything?q=bitcoin&from=2020-01-12&sortBy=publishedAt&apiKey=')
        .then(response =>{
            console.log(response)
            this.setState({posts : response.data})
        })
        .catch(error=>{
            console.log(error)
        })

    }

    render() {
        const {posts}= this.state
        return (
            <div>
             list of posts
             {
                 posts.length ?
                 posts.map(post => <div key ={posts.id}>{post.title}</div>):
                 null
             }   
            </div>
        )
    }
}

export default PostList
